import React, { Component } from "react";
import { connect } from "react-redux";
import "./Medical.scss";
import { FormattedMessage } from "react-intl";
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
class Medical extends Component {
    render() {
        let settings = {
            dots: true,
            infinite: true,
            speed: 300,
            slidesToShow: 1,
            adaptiveHeight: true
        }    
        return (
            <React.Fragment>
                <div className="slider">
            <Slider {...settings}>
                <div className="slide">
                    <div className="card family-insurance">
                        <div className="icon"><img src="family-icon.png" alt="Family Insurance Icon" /></div>
                        <h2>Family Insurance</h2>
                        <a href="#" className="read-more">READ MORE</a>
                    </div>
                </div>
                <div className="slide">
                    <div className="card medical-insurance">
                        <div className="icon"><img src="medical-icon.png" alt="Medical Insurance Icon" /></div>
                        <h2>Medical Insurance</h2>
                        <a href="#" className="read-more">READ MORE</a>
                    </div>
                </div>
                <div className="slide">
                    <div className="card business-insurance">
                        <div className="icon"><img src="business-icon.png" alt="Business Insurance Icon" /></div>
                        <h2>Business Insurance</h2>
                        <a href="#" className="read-more">READ MORE</a>
                    </div>
                </div>
            </Slider>
        </div>
            </React.Fragment>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        language: state.app.language,
        isLoggedIn: state.user.isLoggedIn,
    };
};

const mapDispatchToProps = (dispatch) => {
    return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(Medical);
